To help you successfully transfer your tokens securely to the new Chrysalis (IOTA 1.5) network, we created this guide as an overview of the migration process. There are potentially three ways with which you can migrate your funds from from old (legacy) to new (chrysalis) network: Via Firefly - This procedure is explained in this blog entry . This guide will cover just the programmatic approach to migrate. Via a Migration Address - This procedure uses the wallet library solely for migrating funds from the old to the new network (in this case, you will have to generate and manage your new seed and migration address); Via a legacy Seed - This procedure uses wallet library for generating, managing your new seed, and migration process; Migration Guide - Via a Migration Address With this scenario, you generate your recovery phrase yourself. Then, you generate an address from it, generate the migration address (as in the example below), and then use the same steps performed in section 1 for migrating. With this approach, it's very easy to migrate funds to the new Chrysalis network. You just generate a new Chrysalis address and convert it to the old Trinary Format. If you send Funds to this migration address, it bridges the network and you have the funds available in the Chrysalis network. generate migration address This is an example, how to create a Migration Address with Node.js: function run() { const { AccountManager } = require('../lib') const manager = new AccountManager() let address = "iota1qruzprxum2934lr3p77t96pzlecxv8pjzvtjrzdcgh2f5exa22n6g7c7phd"; let migration_address = manager.generateMigrationAddress(address); console.log(migration_address)
}
run() Code: https://github.com/iotaledger/wallet.rs/blob/develop/bindings/nodejs/tests/migration.js
